__d(function(e,t,o,a){Object.defineProperty(a,"__esModule",{value:!0});var n={name:"castles",sound:"audio/vilenskaja.m4a",style:{},portals:[{name:"monastery",transformPortal:[{translate:[6,0,12]}]},{name:"zamkovaja",transformPortal:[{translate:[14,0,6]}]},{name:"castle",transformPortal:[{translate:[-8,0,10]}]},{name:"francisk",transformPortal:[{translate:[-12,0,-6]}]},{name:"synagoge",transformPortal:[{translate:[14,0,2]}]}],labels:[{offset:-120,viewStyle:{transform:[{translate:[-6,3,8]},{scale:3},{rotateY:130}]},text:{ru:"\u041d\u043e\u0432\u044b\u0439 \u0417\u0430\u043c\u043e\u043a",en:"New Castle"},description:{ru:"\u041d\u043e\u0432\u044b\u0439 \u0437\u0430\u043c\u043e\u043a \u0432 \u0413\u0440\u043e\u0434\u043d\u043e - \u043d\u043e\u0432\u044b\u0439 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 \u0434\u0432\u043e\u0440\u0435\u0446, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0439 \u0432 \u0413\u0440\u043e\u0434\u043d\u043e, \u043d\u0430\u043f\u0440\u043e\u0442\u0438\u0432 \u0441\u0442\u0430\u0440\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0446\u0430 (\u0421\u0442\u0430\u0440\u044b\u0439 \u0437\u0430\u043c\u043e\u043a), \u0432 1734-1751 \u0433\u043e\u0434\u0430\u0445 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043e\u043b\u044f \u0438 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0437\u044f \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0410\u0432\u0433\u0443\u0441\u0442\u0430 III \u043a\u0430\u043a \u043b\u0435\u0442\u043d\u044f\u044f \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0438\u044f \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u0445 \u043a\u043e\u0440\u043e\u043b\u0435\u0439 \u0438 \u0432\u0435\u043b\u0438\u043a\u0438\u0445 \u043a\u043d\u044f\u0437\u0435\u0439 \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u0445, \u043f\u043e \u043f\u0440\u043e\u0435\u043a\u0442\u0443 \u041a\u0430\u0440\u043b\u0430 \u0424\u0440\u0438\u0434\u0440\u0438\u0445\u0430 \u041f\u0451\u043f\u043f\u0435\u043b\u044c\u043c\u0430\u043d\u0430.\n\n                          \u0420\u0430\u0431\u043e\u0442\u044b \u0432 \u0437\u0430\u043c\u043a\u0435 \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u044f\u043b\u0438 \u0442\u0430\u043a\u0436\u0435 \u0418\u043e\u0433\u0430\u043d\u043d \u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u041a\u043d\u0451\u0431\u0435\u043b\u044c, \u0419\u043e\u0445\u0438\u043c \u0414\u0430\u043d\u0438\u044d\u043b\u044c \u042f\u0443\u0445 \u0438 \u0434\u043e 1789 \u0433\u043e\u0434\u0430 \u0414\u0436\u0443\u0437\u0435\u043f\u043f\u0435 \u0434\u0435 \u0421\u0430\u043a\u043a\u043e. \u0417\u0434\u0435\u0441\u044c \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b\u0438 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u0435\u0439\u043c\u044b I \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439. \u0412 \u044d\u0442\u043e\u043c \u0437\u0434\u0430\u043d\u0438\u0438 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0433\u043e \u0441\u0435\u0439\u043c\u0430 \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439 \u0432 1793 \u0433\u043e\u0434\u0443 \u0431\u044b\u043b\u043e \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e \u0440\u0430\u0437\u0434\u0435\u043b\u0435 \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439 \u0441 \u0420\u043e\u0441\u0441\u0438\u0435\u0439 \u0438 \u041f\u0440\u0443\u0441\u0441\u0438\u0435\u0439, \u0430 \u0432 1795 \u0433\u043e\u0434\u0443 \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c \u0438 \u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u043a\u043d\u044f\u0437\u044c \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u0439 \u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432 \u0410\u0432\u0433\u0443\u0441\u0442 \u041f\u043e\u043d\u044f\u0442\u043e\u0432\u0441\u043a\u0438\u0439 \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u043f\u043e\u0434\u043f\u0438\u0441\u044c \u043f\u043e\u0434 \u0430\u043a\u0442\u043e\u043c \u043e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u044f. \u041a\u043e\u0440\u043e\u043b\u044c \u0436\u0438\u043b \u0432 \u043d\u0451\u043c \u0434\u043e 1797 \u0433\u043e\u0434\u0430.\n \n                          \u0412 \u0438\u044e\u043b\u0435 1944 \u0433\u043e\u0434\u0430 \u0437\u0434\u0430\u043d\u0438\u0435 \u0441\u0433\u043e\u0440\u0435\u043b\u043e \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439. \u0412\u043d\u043e\u0432\u044c \u043e\u0442\u0441\u0442\u0440\u043e\u0435\u043d\u043e \u043a 1952 \u0433\u043e\u0434\u0443 \u0432 \u0441\u0442\u0438\u043b\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u043d\u0435\u043e\u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u0430. \u0412 \u043d\u0451\u043c \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u043b\u0441\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u043d\u043e\u0439 \u043a\u043e\u043c\u0438\u0442\u0435\u0442 \u041a\u041f\u0421\u0421. \u0412 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u0442\u0430\u043c \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u0435\u0442\u0441\u044f \u0447\u0430\u0441\u0442\u044c \u044d\u043a\u0441\u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u0413\u0440\u043e\u0434\u043d\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u043e-\u0430\u0440\u0445\u0435\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043c\u0443\u0437\u0435\u044f. \u0412 1994 \u0433\u043e\u0434\u0443 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u043f\u0430\u043c\u044f\u0442\u043d\u0430\u044f \u0434\u043e\u0441\u043a\u0430 \u0432 \u0447\u0435\u0441\u0442\u044c \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f 1794 \u0433. \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c \u0422. \u041a\u043e\u0441\u0442\u044e\u0448\u043a\u043e.\n\n                          \n \u0422\u0435\u043a\u0441\u0442 wikipedia.org",en:"The new castle in Grodno is a new royal palace built in Grodno opposite the old palace (Old Castle) in 1734-1751 during the reign of Polish king and the Grand Duke of Lithuania Augustus III as a summer residence for Polish kings and grand dukes of Lithuania, designed by Carl Friedrich P\xf6ppelmann. \n\n                     Works in the castle were also carried out by Johann Friedrich Kn\xf6bel, Johim Daniel Jauch and until 1789 - by Giuseppe de Sacco. General seims of the first Polish-Lithuanian Commonwealth took place here. In this building during the last seim of the Polish-Lithuanian Commonwealth in 1793 an agreement on the partition of the Commonwealth with Russia and Prussia was signed, and in 1795 the Polish king and the Grand Duke of Lithuania, Stanislaw Augustus Poniatowski, signed an act of abdication. The king lived in the castle until 1797. \n\n                     In July 1944 in result of military operations the building burned down. It was rebuilt in 1952 in Soviet neoclassicism style. It housed the regional committee of the CPSU. Today it is a home to a part of the exposition of Grodno Historical and Archaeological Museum. In 1994 a memorial plate in honor of the national liberation uprising of 1794 under the command of T. Kosciuszko was installed."},infoPosition:1,galleryStyle:{transform:[{translate:[-10,4.5,6]},{rotateY:130}]},oldImages:[{source:"places/castles/old/new_castleXVIII.jpg",year:{ru:"XVIII \u0432. \u0424\u043e\u0442\u043e wikipedia.org",en:"18th c. Photo wikipedia.org"},style:{width:7,height:4.2}},{source:"places/castles/old/new_castleXIX.jpg",year:{ru:"XIX \u0432. \u0424\u043e\u0442\u043e zetgrodno.com",en:"19th c. Photo zetgrodno.com"},style:{width:7,height:4.2}},{source:"places/castles/old/new_castleXX.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by",en:"20th c. Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/new_castle1930th-3.png",year:{ru:"1930-\u0435, \u0424\u043e\u0442\u043e oldgrodno.by",en:"1930th, Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/new_castle1944-50.png",year:{ru:"1944-50 \u0433\u0433. \u0424\u043e\u0442\u043e oldgrodno.by",en:"1944-50, Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/new_castle1982.png",year:{ru:"1982 \u0433. \u0424\u043e\u0442\u043e oldgrodno.by",en:"1982, Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/new_castle1988.png",year:{ru:"1988 \u0433. \u0424\u043e\u0442\u043e oldgrodno.by",en:"1988, Photo oldgrodno.by"},style:{width:7,height:4.2}}]},{offset:0,viewStyle:{transform:[{translate:[1,2,-5]},{scale:1.5}]},text:{ru:"\u0421\u0442\u0430\u0440\u044b\u0439 \u0417\u0430\u043c\u043e\u043a",en:"Old Castle"},description:{ru:"\u0421\u0442\u0430\u0440\u044b\u0439 \u0437\u0430\u043c\u043e\u043a - \u0437\u0430\u043c\u043e\u043a \u0432 \u0413\u0440\u043e\u0434\u043d\u043e. \u041f\u0435\u0440\u0432\u043e\u0435 \u043e\u0431\u043e\u0440\u043e\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043e \u0435\u0449\u0435 \u0432 XI \u0432\u0435\u043a\u0435. \u0412 XIII \u0432\u0435\u043a\u0435 \u0413\u0440\u043e\u0434\u043d\u043e. \u0412 XIII \u0432\u0435\u043a\u0435 \u0413\u0440\u043e\u0434\u043d\u043e \u0432\u043e\u0448\u043b\u043e \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u0430 \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0433\u043e, \u0441 \u043d\u0430\u0447\u0430\u043b\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0433\u043e \u0441\u0442\u043e\u043b\u0435\u0442\u0438\u044f \u0441\u0442\u0430\u043b\u043e \u0446\u0435\u043b\u044c\u044e \u043c\u043d\u043e\u0433\u043e\u0447\u0438\u0441\u043b\u0435\u043d\u043d\u044b\u0445 \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0439 \u043a\u0440\u0435\u0441\u0442\u043e\u043d\u043e\u0441\u0446\u0435\u0432. \u0412 1391 \u0433\u043e\u0434\u0443 \u0437\u0430\u043c\u043e\u043a \u0441\u0442\u0430\u043b \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0433\u043b\u0430\u0432\u043d\u044b\u0445 \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0438\u0439 \u0412\u0438\u0442\u043e\u0432\u0442\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432 1398 \u0433\u043e\u0434\u0443 \u0432\u043c\u0435\u0441\u0442\u043e \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u043e\u0439 \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u0438 \u043f\u043e\u0441\u0442\u0440\u043e\u0438\u043b \u043a\u0430\u043c\u0435\u043d\u043d\u044b\u0439 \u0437\u0430\u043c\u043e\u043a \u0441 \u043f\u044f\u0442\u044c\u044e \u0431\u0430\u0448\u043d\u044f\u043c\u0438. \u042d\u0442\u043e \u0437\u0434\u0430\u043d\u0438\u0435 \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u043b\u043e\u0441\u044c \u0438 \u043f\u043e \u0441\u0435\u0439 \u0434\u0435\u043d\u044c.\n\n                          \u0412 1445 \u0433\u043e\u0434\u0443 \u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u043a\u043d\u044f\u0437\u044c \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u0439 \u041a\u0430\u0437\u0438\u043c\u0438\u0440 IV \u042f\u0433\u0435\u043b\u043b\u043e\u043d\u0447\u0438\u043a \u043f\u0440\u0438\u043d\u044f\u043b \u0437\u0434\u0435\u0441\u044c \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u043b\u0430, \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u0432\u0448\u0435\u0433\u043e \u0435\u043c\u0443 \u043a\u043e\u0440\u043e\u043d\u0443, \u0430 \u0432 1492 \u0433\u043e\u0434\u0443 \u0441\u043a\u043e\u043d\u0447\u0430\u043b\u0441\u044f \u0432 \u0437\u0430\u043c\u043a\u0435. \u0427\u0430\u0441\u0442\u043e \u0437\u0434\u0435\u0441\u044c \u043e\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u043b\u0441\u044f \u0421\u0442\u0435\u0444\u0430\u043d \u0411\u0430\u0442\u043e\u0440\u0438\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0441\u0434\u0435\u043b\u0430\u043b \u0413\u0440\u043e\u0434\u043d\u043e \u0441\u0432\u043e\u0435\u0439 \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439. \u041f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 \u043a\u043e\u0440\u043e\u043b\u044f \u043e\u043a\u043e\u043b\u043e 1580 \u0433\u043e\u0434\u0430 \u0437\u0430\u043c\u043e\u043a \u0431\u044b\u043b \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0435\u043d \u0432 \u0441\u0442\u0438\u043b\u0435 \u0440\u0435\u043d\u0435\u0441\u0441\u0430\u043d\u0441\u0430 \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u043c \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u0421\u043a\u043e\u0442\u0442\u043e \u0438\u0437 \u041f\u0430\u0440\u043c\u044b. \u0412 \u043d\u0430\u0447\u0430\u043b\u0435 XVIII \u0432\u0435\u043a\u0430 \u0431\u044b\u043b \u0441\u043e\u0436\u0436\u0451\u043d \u0448\u0432\u0435\u0434\u0430\u043c\u0438 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0438 \u0443\u0436\u0435 \u043d\u0438\u043a\u043e\u0433\u0434\u0430 \u043d\u0435 \u0438\u043c\u0435\u043b \u0431\u044b\u043b\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f.\n\n                          \n \u0422\u0435\u043a\u0441\u0442 wikipedia.org",en:"The old castle is a castle in Grodno. The first defensive structure dates back as far as to the 11th century. In 13th century Grodno became a part of the Grand Duchy of Lithuania and from the beginning of the next century - the target of numerous Crusader attacks. In 1391 the castle became one of the main residences of Vytautas, who in 1398 instead of a wooden fortress built a stone castle with five towers. This construction largely survived to this day. \n\n                    In 1445 the Grand Duke of Lithuania Casimir IV Jagiellon received here a Polish ambassador that offered him a crown and in 1492 the Duke died in the castle. Stefan Batory, who essentially made Grodno his capital often stayed here. At the initiative of the king around 1580 the castle was rebuilt in Renaissance style by an Italian architect Scotto of Parma. At the beginning of the 18th century it was burned by the Swedes during the Northern War and afterwards never retrieved its former significance."},infoPosition:1800,galleryStyle:{transform:[{translate:[-3,5,-8]}]},oldImages:[{source:"places/castles/old/old_castleXVI.png",year:{ru:"XVI \u0432. \u0424\u043e\u0442\u043e allcastles.ru",en:"16th c. Photo allcastles.ru"},style:{width:7,height:4.2}},{source:"places/castles/old/old_castleXX.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by",en:"20th c. Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/old_castleXX-1.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by",en:"20th c. Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/old_castle1930th.png",year:{ru:"1930-\u0435, \u0424\u043e\u0442\u043e oldgrodno.by",en:"1930th, Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/old_castle1930th-1.png",year:{ru:"1930-\u0435, \u0424\u043e\u0442\u043e oldgrodno.by",en:"1930th, Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/castles/old/old_castle1930th-2.png",year:{ru:"1930-\u0435, \u0424\u043e\u0442\u043e oldgrodno.by",en:"1930th, Photo oldgrodno.by"},style:{width:7,height:4.2}}]}]};a.default=n},350);
__d(function(e,t,o,a){Object.defineProperty(a,"__esModule",{value:!0});var n={name:"zamkovaja",sound:"audio/vilenskaja.m4a",style:{},portals:[{name:"castles",transformPortal:[{translate:[-13,0,2]}]},{name:"center",transformPortal:[{translate:[12,0,7]}]}],labels:[{offset:-90,viewStyle:{transform:[{translate:[-13,3,1]},{scale:3},{rotateY:90}]},text:{ru:"\u041b\u0435\u0432\u0430\u044f \u0441\u0442\u043e\u0440\u043e\u043d\u0430 \u0417\u0430\u043c\u043a\u043e\u0432\u043e\u0439 \u0443\u043b\u0438\u0446\u044b",en:"Left side of Zamkovaya Street"},description:{ru:"\u0417\u0430\u043c\u043a\u043e\u0432\u0430\u044f \u0443\u043b\u0438\u0446\u0430 - \u043e\u0434\u043d\u0430 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0441\u0442\u0430\u0440\u044b\u0445 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0445 \u0443\u043b\u0438\u0446 \u0432 \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 \u0413\u0440\u043e\u0434\u043d\u043e. \u042f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u0432 \u0433\u043e\u0440\u043e\u0434\u0430. \u041f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u043e\u043a\u043e\u043b\u043e 360 \u043c, \u043e\u0442 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u0434\u043e \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u043d\u043e\u0432\u043e\u0433\u043e \u0438 \u0441\u0442\u0430\u0440\u043e\u0433\u043e \u0437\u0430\u043c\u043a\u043e\u0432, \u043e\u0442 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0438 \u043f\u043e\u0448\u043b\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0443\u043b\u0438\u0446\u044b. \u042f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0443\u043b\u0438\u0446\u0435\u0439 \u0432 \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u0438\u0438, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0430\u0445\u043e\u0434\u044f\u0442\u0441\u044f \u0441\u0440\u0430\u0437\u0443 \u0434\u0432\u0430 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0445 \u0437\u0430\u043c\u043a\u0430. \u0412 17 \u0432\u0435\u043a\u0435 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b \u0440\u0430\u0441\u0446\u0432\u0435\u0442 \u0443\u043b\u0438\u0446\u044b, \u043d\u0430 \u043d\u0435\u0439 \u0431\u044b\u043b\u043e \u043d\u0435 \u043c\u0435\u043d\u044c\u0448\u0435, \u0447\u0435\u043c 7 \u0434\u0432\u043e\u0440\u0446\u043e\u0432 \u043c\u0430\u0433\u043d\u0430\u0442\u043e\u0432 \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439.\n\n                          \u0422\u0435\u043a\u0441\u0442 wikipedia.org\n\n                          \u0412 \u043a\u043e\u043d\u0446\u0435 \u0443\u043b\u0438\u0446\u044b \u043c\u043e\u0436\u043d\u043e \u0443\u0432\u0438\u0434\u0435\u0442\u044c \u041f\u043e\u0436\u0430\u0440\u043d\u0443\u044e \u041a\u0430\u043b\u0430\u043d\u0447\u0443 - \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b 20 \u0432\u0435\u043a\u0430, \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0440\u0430\u0441\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442\u0441\u044f \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0449\u0430\u044f \u043f\u043e\u0436\u0430\u0440\u043d\u043e-\u0441\u043f\u0430\u0441\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c.\n\n                          \u041d\u0435\u0441\u043c\u043e\u0442\u0440\u044f \u043d\u0430 \u0432\u0441\u0435 \u0432\u043e\u0439\u043d\u044b, \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f \u0438 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438, \u0433\u043b\u0430\u0432\u043d\u044b\u043c \u0432\u0440\u0430\u0433\u043e\u043c \u0413\u0440\u043e\u0434\u043d\u043e \u0431\u044b\u043b \u043e\u0433\u043e\u043d\u044c. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u0432 1870 \u0433\u043e\u0434\u0443 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u043f\u043e\u044f\u0432\u0438\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u0430\u044f \u0431\u0430\u0448\u043d\u044f \u043f\u043e\u0436\u0430\u0440\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438. \u0422\u0435\u043c \u043d\u0435 \u043c\u0435\u043d\u0435\u0435, \u0434\u0430\u0436\u0435 \u0442\u043e\u0433\u0434\u0430 \u043d\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u043f\u043e\u0431\u043e\u0440\u043e\u0442\u044c \u0441\u0442\u0438\u0445\u0438\u044e. \u0412 \u043c\u0430\u0435 1885 \u0433\u043e\u0434\u0430 \u0432\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435 \u0437\u0430\u0441\u0443\u0445\u0438 \u0437\u0430\u0433\u043e\u0440\u0435\u043b\u0438\u0441\u044c \u0441\u043e\u043b\u043e\u043c\u0435\u043d\u043d\u044b\u0435 \u043a\u0440\u044b\u0448\u0438 \u0434\u043e\u043c\u043e\u0432. \u0412\u0435\u0442\u0435\u0440 \u0431\u044b\u0441\u0442\u0440\u043e \u0440\u0430\u0437\u043d\u0451\u0441 \u043e\u0433\u043e\u043d\u044c \u043f\u043e \u0433\u043e\u0440\u043e\u0434\u0443, \u0430 \u043f\u043e\u0436\u0430\u0440\u043d\u044b\u0435 \u0445\u043e\u0442\u044c \u0438 \u043f\u0440\u0438\u0431\u044b\u043b\u0438 \u0432\u043e\u0432\u0440\u0435\u043c\u044f, \u0432\u0441\u0451 \u0440\u0430\u0432\u043d\u043e \u043d\u0435 \u0443\u0441\u043f\u0435\u043b\u0438 \u043d\u0438\u0447\u0435\u0433\u043e \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u044f\u0442\u044c. \u041f\u043e\u0436\u0430\u0440 \u0431\u0443\u0448\u0435\u0432\u0430\u043b \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 3 \u0434\u043d\u044f, \u0443\u043d\u0435\u0441\u044f \u0434\u0435\u0441\u044f\u0442\u043a\u0438 \u0436\u0438\u0437\u043d\u0435\u0439 \u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0438\u0432 500 \u0441\u0442\u0440\u043e\u0435\u043d\u0438\u0439.\n\n                          \u0412 \u043d\u0430\u0447\u0430\u043b\u0435 20 \u0432\u0435\u043a\u0430 \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u0443\u044e \u043a\u0430\u043b\u0430\u043d\u0447\u0443 \u0437\u0430\u043c\u0435\u043d\u0438\u043b\u0438 \u043d\u0430 \u043a\u0430\u043c\u0435\u043d\u043d\u0443\u044e. \u041e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0431\u043e\u043b\u0435\u0435 \u0432\u044b\u0441\u043e\u043a\u0430\u044f (32 \u043c\u0435\u0442\u0440\u0430), \u0447\u0442\u043e \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u043b\u043e \u0432\u0435\u0441\u0442\u0438 \u043a\u0440\u0443\u0433\u043e\u0432\u043e\u0439 \u043e\u0431\u0437\u043e\u0440 \u0433\u043e\u0440\u043e\u0434\u0430. \u041f\u0440\u0438 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0438\u0438 \u0432\u043e\u0437\u0433\u043e\u0440\u0430\u043d\u0438\u044f \u0434\u0435\u0436\u0443\u0440\u043d\u044b\u0439 \u043d\u0430 \u0432\u0435\u0440\u0448\u0438\u043d\u0435 \u0431\u0430\u0448\u043d\u0438 \u0433\u0440\u043e\u043c\u043a\u043e \u0437\u0432\u043e\u043d\u0438\u043b \u0432 \u043a\u043e\u043b\u043e\u043a\u043e\u043b.\n\n                          \u0422\u0435\u043a\u0441\u0442 grodno.in",en:"Zamkovaya (Castle) street is one of the oldest city streets in Grodno center. It is one of the symbols of the city. Its length is about 360 m, from Soviet square to new and old castles territory, from which the street name derives. It is the only street in Belarus, on which two castles are located at once. 17th century marked golden age of the street when it was occupied with no less than 7 palaces of Polish-Lithuanian Commonwealth magnates. \n\n                        At the end of the street one can see the Fire Tower, an architectural monument of the 20th century, which today stores functional fire and rescue unit. \n\n                        Despite all wars, insurrections and revolutions the main enemy of Grodno was fire. This is why in 1870 the city welcomed the first wooden tower of the fire department. Nevertheless, even then it was not possible to overcome the force of nature. In May 1885 the roofs of the houses started burning due to drought. The wind quickly spread fire around the city, and although firefighters arrived on time they still did not have time to do anything. The fire raged in the city for three days claiming dozens of lives and destroying 500 buildings. \n\n                        At the beginning of the 20th century wooden watchtower was replaced with a stone one. It was higher (32 meters), which allowed to conduct a circular survey of the city. Once an ignition was detected the attendant at the top of the tower loudly rang the bell."},infoPosition:500,galleryStyle:{transform:[{translate:[-11,4.5,0]},{rotateY:90}]},oldImages:[{source:"places/zamkovaja/old/zamkovajaLeftXX-3.png",year:{ru:"XX \u0432.",en:"20th c."},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/zamkovajaLeftXX.jpg",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e grodnonews.by, \u0412.\u0421\u0430\u044f\u043f\u0438\u043d",en:"20th c. Photo grodnonews.by, V.Sayapin"},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/zamkovajaLeftXX-1.jpg",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e grodnonews.by, \u0412.\u0421\u0430\u044f\u043f\u0438\u043d",en:"20th c. Photo grodnonews.by, V.Sayapin"},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/zamkovajaLeftXX-2.jpg",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by, \u0424.\u0412\u043e\u0440\u043e\u0448\u0438\u043b\u044c\u0441\u043a\u0438\u0439",en:"20th c. Photo oldgrodno.by, F.Woroszylski"},style:{width:7,height:4.2}}]},{offset:120,viewStyle:{transform:[{translate:[11,3,5]},{scale:3},{rotateY:-120}]},text:{ru:"\u041f\u0440\u0430\u0432\u0430\u044f \u0441\u0442\u043e\u0440\u043e\u043d\u0430 \u0417\u0430\u043c\u043a\u043e\u0432\u043e\u0439 \u0443\u043b\u0438\u0446\u044b",en:"Right side of Zamkovaya Street"},description:{ru:"\u0417\u0430\u043c\u043a\u043e\u0432\u0430\u044f \u0443\u043b\u0438\u0446\u0430 - \u043e\u0434\u043d\u0430 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0441\u0442\u0430\u0440\u044b\u0445 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0445 \u0443\u043b\u0438\u0446 \u0432 \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 \u0413\u0440\u043e\u0434\u043d\u043e. \u042f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u0432 \u0433\u043e\u0440\u043e\u0434\u0430. \u041f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u043e\u043a\u043e\u043b\u043e 360 \u043c, \u043e\u0442 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u0434\u043e \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u043d\u043e\u0432\u043e\u0433\u043e \u0438 \u0441\u0442\u0430\u0440\u043e\u0433\u043e \u0437\u0430\u043c\u043a\u043e\u0432, \u043e\u0442 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0438 \u043f\u043e\u0448\u043b\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0443\u043b\u0438\u0446\u044b. \u042f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0443\u043b\u0438\u0446\u0435\u0439 \u0432 \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u0438\u0438, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0430\u0445\u043e\u0434\u044f\u0442\u0441\u044f \u0441\u0440\u0430\u0437\u0443 \u0434\u0432\u0430 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0445 \u0437\u0430\u043c\u043a\u0430.\n\n                          \u041d\u0430 \u0443\u043b\u0438\u0446\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u044b \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u044b\u0435 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0438 \u0440\u0430\u0437\u043d\u044b\u0445 \u044d\u043f\u043e\u0445: \u043d\u0430\u0447\u0438\u043d\u0430\u044f \u043e\u0442 \u0434\u0440\u0435\u0432\u043d\u0435\u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u043f\u0435\u0440\u0438\u043e\u0434\u0430 \u0438 \u043a\u043e\u043d\u0447\u0430\u044f \u043d\u0430\u0447\u0430\u043b\u043e\u043c 20 \u0432\u0435\u043a\u0430. \u0423\u043b\u0438\u0446\u0430 \u043f\u0440\u0435\u0442\u0435\u0440\u043f\u0435\u043b\u0430 \u043d\u0430 \u0441\u0435\u0431\u0435 \u0432\u0441\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u044f \u0438 \u043b\u0438\u0445\u043e\u043b\u0435\u0442\u044c\u044f, \u0432\u044b\u043f\u0430\u0432\u0448\u0438\u0435 \u043d\u0430 \u0434\u043e\u043b\u044e \u0433\u043e\u0440\u043e\u0434\u0430, \u0435\u0451 \u0437\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0430 \u043c\u043d\u043e\u0433\u043e \u0440\u0430\u0437 \u0440\u0430\u0437\u0440\u0443\u0448\u0430\u043b\u0430\u0441\u044c \u0438 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u043b\u0430\u0441\u044c. \u0412 17 \u0432\u0435\u043a\u0435 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b \u0440\u0430\u0441\u0446\u0432\u0435\u0442 \u0443\u043b\u0438\u0446\u044b, \u043d\u0430 \u043d\u0435\u0439 \u0431\u044b\u043b\u043e \u043d\u0435 \u043c\u0435\u043d\u044c\u0448\u0435, \u0447\u0435\u043c 7 \u0434\u0432\u043e\u0440\u0446\u043e\u0432 \u043c\u0430\u0433\u043d\u0430\u0442\u043e\u0432 \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439. \u0423\u043b\u0438\u0446\u0430 \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u043f\u0435\u0440\u0435\u043d\u0435\u0441\u043b\u0430 \u0434\u0432\u0435 \u043c\u0438\u0440\u043e\u0432\u044b\u0435 \u0432\u043e\u0439\u043d\u044b, \u043e\u0434\u043d\u0430\u043a\u043e \u043d\u0430\u0438\u0431\u043e\u043b\u044c\u0448\u0438\u0435 \u043f\u043e\u0442\u0435\u0440\u0438 \u043f\u043e\u043d\u0435\u0441\u043b\u0430 \u0432 \u043c\u0438\u0440\u043d\u043e\u0435 \u0432\u0440\u0435\u043c\u044f, \u043a\u043e\u0433\u0434\u0430 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u043c\u0438 \u0432\u043b\u0430\u0441\u0442\u044f\u043c\u0438 \u0431\u044b\u043b\u0430 \u0441\u043d\u0435\u0441\u0435\u043d\u0430 \u0441\u0430\u043c\u0430\u044f \u0441\u0442\u0430\u0440\u0430\u044f \u0438 \u0446\u0435\u043d\u043d\u0430\u044f \u0437\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0430 \u0447\u0435\u0442\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0443\u043b\u0438\u0446\u044b, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0432\u0437\u043e\u0440\u0432\u0430\u043d\u043e \u0441\u0430\u043c\u043e\u0435 \u0432\u044b\u0441\u043e\u0442\u043d\u043e\u0435 \u043d\u0430 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u0437\u0434\u0430\u043d\u0438\u0435 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 - \u0424\u0430\u0440\u0430 \u0412\u0438\u0442\u043e\u0432\u0442\u0430.\n\n                          \n \u0422\u0435\u043a\u0441\u0442 wikipedia.org",en:"Zamkovaya street is one of the oldest city streets in Grodno center. It is one of the symbols of the city. Its length is about 360 m, from Soviet square to new and old castles territory, from which the street name of derives. It is the only street in Belarus, on which two castles are located at once. \n\n                        The street locates architectural monuments of different eras: from early Russian period to the beginning of the 20th century. The street has undergone all trials and hardships that fell on the city, its construction has many times been destroyed  and restored. 17th century marked golden age of the street when it was occupied with no less than 7 palaces of Polish-Lithuanian Commonwealth magnates. The street successfully came through two world wars, but suffered greatest losses in peacetime when Soviet authorities demolished the oldest and most valuable building on even side of the street, as well as blown up the tallest building in the city then - Fara Vytayta."},infoPosition:3700,galleryStyle:{transform:[{translate:[4,5,4]},{rotateY:-120}]},oldImages:[{source:"places/zamkovaja/old/zamkovajaRightXX.jpg",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e grodnonews.by, \u0412.\u0421\u0430\u044f\u043f\u0438\u043d",en:"20th c. Photo grodnonews.by, V.Sayapin"},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/zamkovajaRightXX-1.jpg",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e grodnonews.by, \u0412.\u0421\u0430\u044f\u043f\u0438\u043d",en:"20th c. Photo grodnonews.by, V.Sayapin"},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/zamkovajaRightXX-2.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by, \u0424.\u0412\u043e\u0440\u043e\u0448\u0438\u043b\u044c\u0441\u043a\u0438\u0439",en:"20th c. Photo oldgrodno.by, F.Woroszylski"},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/zamkovajaRight30.png",year:{ru:"1930-\u0435, \u0424\u043e\u0442\u043e oldgrodno.by",en:"1930th, Photo oldgrodno.by"},style:{width:6.2,height:5.2}},{source:"places/zamkovaja/old/zamkovajaRight1915.png",year:{ru:"1915 \u0433. \u0424\u043e\u0442\u043e oldgrodno.by, \u0424.\u0412\u043e\u0440\u043e\u0448\u0438\u043b\u044c\u0441\u043a\u0438\u0439",en:"1915, Photo oldgrodno.by, F.Woroszylski"},style:{width:7,height:4.2}}]},{offset:0,viewStyle:{transform:[{translate:[-1,2,-5]},{scale:1.5}]},text:{ru:"\u041f\u0430\u043c\u044f\u0442\u043d\u0430\u044f \u0442\u0430\u0431\u043b\u0438\u0447\u043a\u0430 \u043d\u0430 \u0432\u0445\u043e\u0434\u0435 \u0432 \u0431\u044b\u0432\u0448\u0435\u0435 \u0433\u0435\u0442\u0442\u043e",en:"Memorial plaque at former ghetto entrance "},description:{ru:"\u0413\u0435\u0442\u0442\u043e \u0432 \u0413\u0440\u043e\u0434\u043d\u043e (\u043d\u043e\u044f\u0431\u0440\u044c 1941 - 12 \u043c\u0430\u0440\u0442\u0430 1943) - \u0435\u0432\u0440\u0435\u0439\u0441\u043a\u043e\u0435 \u0433\u0435\u0442\u0442\u043e, \u043c\u0435\u0441\u0442\u043e \u043f\u0440\u0438\u043d\u0443\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0435\u0432\u0440\u0435\u0435\u0432 \u0433\u043e\u0440\u043e\u0434\u0430 \u0413\u0440\u043e\u0434\u043d\u043e \u0432 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0435 \u043f\u0440\u0435\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f \u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u044f \u0435\u0432\u0440\u0435\u0435\u0432 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043e\u043a\u043a\u0443\u043f\u0430\u0446\u0438\u0438 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u0438\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043d\u0430\u0446\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u0432 \u043f\u0435\u0440\u0438\u043e\u0434 \u0412\u0442\u043e\u0440\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b.\n\n                    \u0412 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u0435 1941 \u0433\u043e\u0434\u0430 \u043d\u0430\u0446\u0438\u0441\u0442\u044b \u043d\u0430\u0447\u0430\u043b\u0438 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u0442\u044c \u0432 \u0413\u0440\u043e\u0434\u043d\u043e 2 \u0433\u0435\u0442\u0442\u043e, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0437\u0430\u043d\u044f\u043b\u0438 \u043f\u043b\u043e\u0449\u0430\u0434\u044c \u043e\u043a\u043e\u043b\u043e 1,5 \u0433\u0435\u043a\u0442\u0430\u0440\u043e\u0432 (\u0443\u043b\u0438\u0446\u0430 \u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u043a\u0430\u044f (\u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430\u044f \u0443\u043b\u0438\u0446\u0430 \u0410\u043d\u0442\u043e\u043d\u043e\u0432\u0430) \u0438 \u0440\u0430\u0439\u043e\u043d \u0443\u043b\u0438\u0446\u044b \u0411\u043e\u043b\u044c\u0448\u0430\u044f \u0422\u0440\u043e\u0438\u0446\u043a\u0430\u044f).\n\n                    \u0413\u0435\u0442\u0442\u043e \u0431\u044b\u043b\u043e \u0441\u043e\u0437\u0434\u0430\u043d\u043e \u0432 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u0433\u043e\u0440\u043e\u0434\u0430, \u0432 \xab\u0421\u0442\u0430\u0440\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435\xbb, \u043d\u0435\u0434\u0430\u043b\u0435\u043a\u043e \u043e\u0442 \u0437\u0430\u043c\u043a\u0430 \u0438 \u0432\u043e\u043a\u0440\u0443\u0433 \u0411\u043e\u043b\u044c\u0448\u043e\u0439 \u0441\u0438\u043d\u0430\u0433\u043e\u0433\u0438, - \u043d\u0430 \u0443\u043b\u0438\u0446\u0430\u0445 \u0421\u043a\u0438\u0434\u0435\u043b\u044c\u0441\u043a\u043e\u0439 \u0438 \u041f\u0435\u0440\u0435\u0446\u0430, \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0421\u043a\u0438\u0434\u0435\u043b\u044c\u0441\u043a\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438, \u0430 \u0435\u0433\u043e \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0432\u0445\u043e\u0434 \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0441\u044f \u0441\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0443\u043b\u0438\u0446\u044b \u0417\u0430\u043c\u043a\u043e\u0432\u043e\u0439. \u041d\u0430 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u043c\u0435\u043d\u044c\u0448\u0435 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u044b \u043a\u0432\u0430\u0434\u0440\u0430\u0442\u043d\u043e\u0433\u043e \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u0430 \u043e\u043d\u043e \u0432\u043c\u0435\u0441\u0442\u0438\u043b\u043e 15 000 \u0443\u0437\u043d\u0438\u043a\u043e\u0432 \u0438 \u043f\u0440\u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u043e \u0441 \u043d\u043e\u044f\u0431\u0440\u044f 1941 \u0433\u043e\u0434\u0430 \u043f\u043e \u043c\u0430\u0440\u0442 1943 \u0433\u043e\u0434\u0430. \u0413\u0435\u0442\u0442\u043e \u0431\u044b\u043b\u043e \u043e\u043a\u0440\u0443\u0436\u0435\u043d\u043e 2-\u043c\u0435\u0442\u0440\u043e\u0432\u044b\u043c \u0437\u0430\u0431\u043e\u0440\u043e\u043c.\n\n                    \u0412 1991 \u0433\u043e\u0434\u0430 \u043d\u0430 \u0443\u043b\u0438\u0446\u0435 \u0417\u0430\u043c\u043a\u043e\u0432\u043e\u0439, \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0435\u0439\u0441\u044f \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0432\u043e\u0439\u043d\u044b \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \u0434\u0432\u0443\u0445 \u0433\u0435\u0442\u0442\u043e, \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u043c\u0435\u043c\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u0430\u044f \u043f\u043b\u0438\u0442\u0430 \u0432 \u043f\u0430\u043c\u044f\u0442\u044c \u043e \u0435\u0432\u0440\u0435\u044f\u0445 \u0413\u0440\u043e\u0434\u043d\u043e \u0438 \u0431\u043b\u0438\u0437\u043b\u0435\u0436\u0430\u0449\u0438\u0445 \u043d\u0430\u0441\u0435\u043b\u0451\u043d\u043d\u044b\u0445 \u043f\u0443\u043d\u043a\u0442\u043e\u0432, \u0443\u0431\u0438\u0442\u044b\u0445 \u043d\u0430\u0446\u0438\u0441\u0442\u0430\u043c\u0438 \u0438 \u0438\u0445 \u043f\u043e\u0441\u043e\u0431\u043d\u0438\u043a\u0430\u043c\u0438\n\n                    \n \u0422\u0435\u043a\u0441\u0442 wikipedia.org",en:'Grodno ghetto (November 1941 - March 12, 1943) is a Jewish ghetto, place of forced resettlement of Jews in Grodno in the course of persecution and annihilation of Jews during the occupation of the territory of Belarus by the  of Nazi Germany troops during the Second World War. \n\n                        In September 1941, the Nazis began to organize two ghettos in Grodno, which were located on approximately 1.5 hectares (Jerusalem street (today - Antonova street) and Bolshaya Troitskaya street). \n\n                        Ghetto was created in the central part of the city, in "Old Town", not far from the castle and around the Great Synagogue, on Skidelskaya and Peretz streets, in Skidel area, and its central entrance was located on Zamkovaya street. On its less than half a square kilometers, it accommodated 15,000 prisoners and existed from November 1941 to March 1943. Ghetto was surrounded by a 2-meter fence. \n\n                        In 1991 on Zamkovaya Street, which belonged to the territory of one of ghettos during the war, a memorial plaque was erected in memory of  Jews of Grodno and nearby settlements killed by the Nazis and their accomplices.'},infoPosition:1800,infoWidth:1300,infoHeight:900,model:{style:{transform:[{translate:[18,3.5,-18]},{rotateZ:-55},{rotateX:0},{rotateY:-10}]},rotationAxis:"rotateZ",obj:"models/getto/getto.obj",mtl:"models/getto/getto.mtl",controls:{transform:[{translate:[-1,-.5,-10]},{rotateY:-30}]}},galleryStyle:{transform:[{translate:[-5,5,-8]}]},oldImages:[{source:"places/zamkovaja/old/ghetto.jpg",year:{ru:"1941 \u0433. \u0424\u043e\u0442\u043e wikipedia.org",en:"1941, Photo wikipedia.org"},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/ghetto1.jpg",year:{ru:"1941 \u0433. \u0424\u043e\u0442\u043e wikipedia.org",en:"1941, Photo wikipedia.org"},style:{width:7,height:4.2}}]},{offset:-180,viewStyle:{transform:[{translate:[-1,2,5]},{scale:1.5},{rotateY:180}]},text:{ru:"\u0414\u043e\u043c \u0431\u044b\u0442\u0430",en:"House of Life"},description:{ru:"------",en:"------"},infoPosition:5,galleryStyle:{transform:[{translate:[-5,5,8]},{rotateY:180}]},oldImages:[{source:"places/zamkovaja/old/dom1971.jpg",year:{ru:"1971 \u0433. \u0424\u043e\u0442\u043e old.grodno.net",en:"1971, Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zamkovaja/old/dom1971-1.jpg",year:{ru:"1971 \u0433. \u0424\u043e\u0442\u043e old.grodno.net",en:"1971, Photo old.grodno.net"},style:{width:7,height:4.2}}]}]};a.default=n},351);
__d(function(e,t,o,n){Object.defineProperty(n,"__esModule",{value:!0});var a={name:"zags",sound:"audio/vilenskaja.m4a",style:{},portals:[{name:"vilenskaja",transformPortal:[{translate:[-1,0,-12]}]},{name:"lenina",transformPortal:[{translate:[-1,0,13]}]},{name:"pochta",transformPortal:[{translate:[-10,0,8]}]}],labels:[{offset:-120,viewStyle:{transform:[{translate:[-8,3,4]},{scale:3},{rotateY:120}]},text:{ru:"\u041d\u0430\u0447\u0430\u043b\u043e \u0443\u043b. \u042d\u043b\u0438\u0437\u044b \u041e\u0436\u0435\u0448\u043a\u043e",en:"Beginning of Eliza Ozheshko Street"},description:{ru:'\u041d\u0430\u0447\u0430\u043b\u043e \u0443\u043b\u0438\u0446\u044b \u042d\u043b\u0438\u0437\u044b \u041e\u0436\u0435\u0448\u043a\u043e, \u0443\u043b\u0438\u0446\u0430 \u0441\u0432\u044f\u0437\u044b\u0432\u0430\u0435\u0442 \u0446\u0435\u043d\u0442\u0440 \u0413\u0440\u043e\u0434\u043d\u043e \u0441 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u043c \u0432\u043e\u043a\u0437\u0430\u043b\u043e\u043c.\n\n                          \u0421\u043b\u0435\u0432\u0430 \u043f\u043e \u0443\u043b\u0438\u0446\u0435 \u0440\u0430\u043d\u0435\u0435 \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0441\u044f \u043e\u0442\u0435\u043b\u044c "\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f" (\u043e\u043d \u0436\u0435 \u043e\u0442\u0435\u043b\u044c "\u041d\u044c\u044e-\u0419\u043e\u0440\u043a"), \u0438\u043c\u0435\u043d\u043d\u043e \u0435\u0433\u043e \u043c\u043e\u0436\u043d\u043e \u0440\u0430\u0437\u0433\u043b\u044f\u0434\u0435\u0442\u044c \u043d\u0430 \u0441\u0442\u0430\u0440\u044b\u0445 \u0444\u043e\u0442\u043e. \u041d\u0430 \u0435\u0433\u043e \u043c\u0435\u0441\u0442\u0435 \u0432 1930-\u0445 \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u0431\u0430\u043d\u043a \u0432 \u0441\u0442\u0438\u043b\u0435 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u0438\u0432\u0438\u0437\u043c\u0430.\n\n                          \u0421\u043f\u0440\u0430\u0432\u0430 \u043f\u043e \u0443\u043b\u0438\u0446\u0435 - \u0434\u0432\u043e\u0440\u0435\u0446 \u043a\u043d\u044f\u0436\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u043e\u0434\u0430 \u041c\u0430\u0441\u0430\u043b\u044c\u0441\u043a\u0438\u0445 \u0438 \u0434\u043e\u043c \u0432\u0438\u0446\u0435-\u0433\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440\u0430 \u041c\u0430\u043a\u0441\u0438\u043c\u043e\u0432\u0438\u0447\u0430. \u0414\u043e\u043c \u0431\u044b\u043b \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u0432 1803 \u0433\u043e\u0434\u0443 \u0432 \u0441\u0442\u0438\u043b\u0435 \u043a\u043b\u0430\u0441\u0438\u0446\u0438\u0437\u043c\u0430. \u0413\u043b\u0430\u0432\u043d\u044b\u0439 \u0444\u0430\u0441\u0430\u0434 \u0437\u0434\u0430\u043d\u0438\u044f \u0443\u043a\u0440\u0430\u0448\u0435\u043d 4-\u043a\u043e\u043b\u043e\u043d\u043d\u044b\u043c \u043f\u043e\u0440\u0442\u0438\u043a\u043e\u043c \u0438 \u0434\u0432\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u043e\u0440\u0434\u0435\u0440\u043e\u043c. \u0417\u0430 \u0434\u0432\u043e\u0440\u0446\u043e\u043c \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0441\u044f \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u043f\u0435\u0439\u0437\u0430\u0436\u043d\u044b\u0439 \u043f\u0430\u0440\u043a \u0441 \u043a\u0430\u043c\u0435\u043d\u043d\u043e\u0439 \u0431\u0435\u0441\u0435\u0434\u043a\u043e\u0439-\u0440\u043e\u0442\u043e\u043d\u0434\u043e\u0439 \u0432 \u0441\u0442\u0438\u043b\u0435 \u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u0430. \u0412\u043e \u0432\u0440\u0435\u043c\u044f \u0432\u043e\u0439\u043d\u044b \u0420\u043e\u0441\u0441\u0438\u0438 \u0438 \u0424\u0440\u0430\u043d\u0446\u0438\u0438 1812 \u0433\u043e\u0434\u0430 \u0437\u0434\u0435\u0441\u044c \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u043b\u0441\u044f \u0448\u0442\u0430\u0431 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0430\u043b\u0430 \u0416\u0435\u0440\u043e\u043c\u0430 \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\u0430. \u0422\u0435\u043f\u0435\u0440\u044c \u0432 \u0437\u0434\u0430\u043d\u0438\u0438 \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u0435\u0442\u0441\u044f \u0440\u0435\u0441\u0442\u043e\u0440\u0430\u043d.',en:'The beginning of Elisa Ozheshko street, which connects the center of Grodno with the railway station. \n\n                    On the left used to be located the hotel "Switzerland" (or hotel "New York"), which can be seen in the old photos. On its place in the 1930\'s a  bank in constructivism style was built. \n\n                    On the right stands the palace of the Masalski princely family  and vice-governor Maksimovich\u2019s house. The house was built in 1803 in classicism style. The main facade of the building is decorated with a 4-column portico and a courtyard warrant. Behind the palace a small landscape park with a stone arbor-rotunda in classicism style was located. During the war between Russia and France in 1812 French Marshal Jerome Bonaparte\u2019s headquarters were located here. Today the building houses a restaurant.'},infoPosition:100,galleryStyle:{transform:[{translate:[-11,4.5,4]},{rotateY:120}]},oldImages:[{source:"places/zags/old/ozheshkoXIX-XX.png",year:{ru:"XIX-XX \u0432\u0432.",en:"19-20th c."},style:{width:7,height:4.2}},{source:"places/zags/old/ozheshkoXIX.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/ozheshkoXIX-1.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/ozheshkoXIX-2.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/ozheshkoXIX-3.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/ozheshkoXIX-4.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/ozheshkoXIX-5.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}}]},{offset:0,viewStyle:{transform:[{translate:[0,2,-4]},{scale:1.5}]},text:{ru:"\u0443\u043b. \u0414\u043e\u043c\u0438\u043d\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f (\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f)",en:"Dominican (Soviet) Street"},description:{ru:"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0443\u043b\u0438\u0446\u0430 (\u0440\u0430\u043d\u044c\u0448\u0435 \u0412\u0438\u043b\u0435\u043d\u0441\u043a\u0430\u044f, \u0421\u043e\u0431\u043e\u0440\u043d\u0430\u044f, \u0414\u043e\u043c\u0438\u043d\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f) - \u043e\u0434\u043d\u0430 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0441\u0442\u0430\u0440\u044b\u0445 \u0443\u043b\u0438\u0446 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 \u0413\u0440\u043e\u0434\u043d\u043e, \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043f\u0435\u0448\u0435\u0445\u043e\u0434\u043d\u0430\u044f \u0443\u043b\u0438\u0446\u0430 \u0433\u043e\u0440\u043e\u0434\u0430 (\u0441 1964 \u0433). \u0412 1930-\u0435 \u0443\u043b\u0438\u0446\u0443 \u0432\u044b\u043b\u043e\u0436\u0438\u043b\u0438 \u0431\u0440\u0443\u0441\u0447\u0430\u0442\u043a\u043e\u0439. \u041f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u043e\u043a\u043e\u043b\u043e 500 \u043c\u0435\u0442\u0440\u043e\u0432 \u043e\u0442 \u041f\u043b\u043e\u0449\u0430\u0434\u0438 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0434\u043e \u0443\u043b\u0438\u0446\u044b \u042d\u043b\u0438\u0437\u044b \u041e\u0436\u0435\u0448\u043a\u0438. \u041d\u0430 \u0443\u043b\u0438\u0446\u0435 \u043d\u0430\u0445\u043e\u0434\u044f\u0442\u0441\u044f \u043c\u043d\u043e\u0433\u043e\u0447\u0438\u0441\u043b\u0435\u043d\u043d\u044b\u0435 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u044b\u0435, \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0435, \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u044b\u0435 \u0438 \u0440\u0430\u0437\u0432\u043b\u0435\u043a\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u044f.\n \n                          \u0423\u043b\u0438\u0446\u0430 \u0438\u043c\u0435\u0435\u0442 \u0431\u043e\u043b\u044c\u0448\u0443\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0446\u0435\u043d\u043d\u043e\u0441\u0442\u044c, \u0438, \u0437\u0430 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u043c \u0438\u0441\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435\u043c, \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u043b\u0430\u0441\u044c \u043f\u043e\u0447\u0442\u0438 \u0432\u0441\u044f \u0437\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0430 XIX - \u043d\u0430\u0447\u0430\u043b\u043e XX \u0432\u0435\u043a\u0430.\n\n                          \u041d\u0430 \u0443\u043b\u0438\u0446\u0435 \u0436\u0438\u043b\u0438 \u0438 \u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0438 \u043c\u043d\u043e\u0433\u0438\u0435 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0438 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0439 1830-1831 \u0438 1863-1864 \u0433\u043e\u0434\u043e\u0432.\n\n                          \n\n \u0422\u0435\u043a\u0441 wikipedia.org",en:"Sovetskaya street (formerly Vilenskaya, Sobornaya, Dominican) is one of the oldest streets in the historical center of Grodno and the central pedestrian street of the city (since 1964). In the 1930s the street was laid out with paving stones. Its length amounts to about 500 meters from Sovetskaya square to Eliza Ozheshko street. The street locates numerous administrative, commercial, cultural and entertainment venues. \n\n                     The street has a great historical value and with some exceptions almost the whole construction of the 19th - beginning of the 20th century has been preserved. \n\n                     The street located homes and workplaces of many participants of the uprisings of 1830-1831 and 1863-1864."},infoPosition:1800,galleryStyle:{transform:[{translate:[-5,5,-8]},{rotateY:10}]},oldImages:[{source:"places/zags/old/dominikXIX.jpg",year:{ru:"XIX \u0432. \u041d.\u041e\u0440\u0434\u0430",en:"19th c. N.Orda"},style:{width:7,height:4.2}},{source:"places/zags/old/dominikXIX-XX.png",year:{ru:"XIX-XX \u0432\u0432.",en:"19-20th c."},style:{width:7,height:4.2}},{source:"places/zags/old/dominikXIX.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/dominikXIX-1.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/dominikXIX-2.png",year:{ru:"XIX-XX \u0432\u0432. \u0424\u043e\u0442\u043e old.grodno.net",en:"19-20th c. Photo old.grodno.net"},style:{width:7,height:4.2}},{source:"places/zags/old/dominikXX.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e kinogrodno.by",en:"20th c. Photo kinogrodno.by"},style:{width:7,height:4.2}}]}]};n.default=a},352);
__d(function(e,t,o,r){Object.defineProperty(r,"__esModule",{value:!0});var n={name:"towers",sound:"audio/vilenskaja.m4a",style:{},portals:[{name:"bridge",transformPortal:[{translate:[6,0,-8]}]}],labels:[{offset:-15,viewStyle:{transform:[{translate:[-2,2,-5]},{scale:1.5},{rotateY:25}]},text:{ru:"\u0412\u043e\u0434\u043e\u043d\u0430\u043f\u043e\u0440\u043d\u044b\u0435 \u0431\u0430\u0448\u043d\u0438",en:"Water Towers"},description:{ru:"\u0412\u043e\u0434\u043e\u043d\u0430\u043f\u043e\u0440\u043d\u044b\u0435 \u0431\u0430\u0448\u043d\u0438 \u0441\u0442\u043e\u044f\u0442 \u043d\u0430 \u043a\u0440\u0430\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0446\u0435\u043d\u0442\u0440\u0430, \u043d\u0430\u0434 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u043e\u0439, \u043d\u0430\u043f\u0440\u043e\u0442\u0438\u0432 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0433\u043e \u0440\u044b\u043d\u043a\u0430. \u0412\u044b\u0441\u043e\u0442\u0430 \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0445 \u0431\u0430\u0448\u0435\u043d 22 \u043c\u0435\u0442\u0440\u0430. \u041d\u0430\u043a\u0440\u044b\u0442\u044b 8-\u043c\u0438 \u0441\u043a\u0430\u0442\u043d\u044b\u043c\u0438 \u043a\u0440\u044b\u0448\u0430\u043c\u0438. \u0412 \u0446\u0435\u043d\u0442\u0440\u0435 - \u0442\u0440\u0443\u0431\u044b \u0434\u043b\u044f \u043f\u043e\u0434\u0430\u0447\u0438 \u0432\u043e\u0434\u044b \u0432 \u0440\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u044b \u0432 \u0432\u0435\u0440\u0445\u043d\u0438\u0435 \u0447\u0430\u0441\u0442\u0438 \u0431\u0430\u0448\u0435\u043d. \u041e\u043d\u0438 \u0431\u044b\u043b\u0438 \u0432\u043e\u0437\u0432\u0435\u0434\u0435\u043d\u044b \u043f\u043e\u0441\u043b\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f \u0432 \u0413\u0440\u043e\u0434\u043d\u043e \u0432\u043e\u0434\u043e\u043f\u0440\u043e\u0432\u043e\u0434\u0430 \u043f\u0440\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0438 \xab\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u043d\u043e\u0433\u043e \u0432\u043e\u0434\u043d\u043e\u0433\u043e \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430\xbb \u0438 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0442 \u043a \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430\u043c \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b \u0432 \u0441\u0442\u0438\u043b\u0435 \u044d\u043a\u043b\u0435\u043a\u0442\u0438\u043a\u0438.\n\n                          24 \u0444\u0435\u0432\u0440\u0430\u043b\u044f 1876 \u0433\u043e\u0434\u0430, \u043f\u043e \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u044e \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u043d\u043e-\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0438 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0440\u0430\u0431\u043e\u0442, \u0432\u043e\u0434\u0430 \u0438\u0437 \u041d\u0435\u043c\u0430\u043d\u0430 \u043d\u0430\u0441\u043e\u0441\u0430\u043c\u0438 \u0447\u0435\u0440\u0435\u0437 \u0444\u0438\u043b\u044c\u0442\u0440\u044b \u0431\u044b\u043b\u0430 \u043f\u043e\u0434\u0430\u043d\u0430 \u0432 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0434\u043e\u043f\u0440\u043e\u0432\u043e\u0434. \u041e\u0431 \u044d\u0442\u043e\u043c \u0433\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440 \u0413\u0440\u043e\u0434\u043d\u0435\u043d\u0441\u043a\u043e\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0438 \u0441\u043e\u043e\u0431\u0449\u0438\u043b \u0415\u0433\u043e \u041f\u0440\u0435\u0432\u043e\u0441\u0445\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443 \u041c\u0438\u043d\u0438\u0441\u0442\u0440\u0443 \u0412\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0414\u0435\u043b \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u0438\u0441\u044c\u043c\u0435\u043d\u043d\u043e. \u042d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0438 \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f \u0434\u043d\u0435\u043c \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u0432\u043e\u0434\u043e\u0441\u043d\u0430\u0431\u0436\u0435\u043d\u0438\u044f \u0433. \u0413\u0440\u043e\u0434\u043d\u043e.\n\n                          \u041f\u0435\u0440\u0432\u0430\u044f, \u042e\u0436\u043d\u0430\u044f \u0431\u0430\u0448\u043d\u044f (\u043f\u043e\u043a\u0440\u0430\u0448\u0435\u043d\u0430 \u0432 \u0440\u043e\u0437\u043e\u0432\u044b\u0439 \u0446\u0432\u0435\u0442) \u0432\u043e\u0437\u0432\u0435\u0434\u0435\u043d\u0430 \u0432 1890 \u0433\u043e\u0434\u0443. \u0412\u0442\u043e\u0440\u0430\u044f, \u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0431\u0430\u0448\u043d\u044f \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u0430 \u0432 1910 \u0433\u043e\u0434\u0443 (\u0436\u0435\u043b\u0442\u043e\u0433\u043e \u0446\u0432\u0435\u0442\u0430, \u0438 \u043e\u043d\u0430 \u0431\u043b\u0438\u0436\u0435 \u043a \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0435).\n\n                          \n\n \u0422\u0435\u043a\u0441 zetgrodno.com",en:'Water towers stand on the edge of the historic center above the railway and opposite the city market. The height of brick towers amounts to 22 meters. They are covered with eight pitched roofs. In the center stand the pipes for supplying water to the tanks in the upper part of the towers. They were constructed with the participation of the "All-Russian Joint Water Society" after the opening of the water pipeline in Grodno and belong to the monuments of eclecticism style architecture in. \n\n                     On February 24, 1876 after the completion of engineering and construction works, the water from Neman started being pumped through filters to the city water supply system. Grodno Province Governor reported this in writing to His Excellency the Minister of the Interior Affairs of Russia. This day is considered the birthday of the centralized water supply in Grodno. \n\n                     The first, South Tower (painted in pink), was built in 1890. The second, Northern Tower, was built in 1910 (painted in yellow, and is located closer to the railway).'},infoPosition:1600,galleryStyle:{transform:[{translate:[-5,6,-8]},{rotateY:15}]},oldImages:[{source:"places/towers/old/towersXX.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by",en:"20th c. Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/towers/old/towers1930th.png",year:{ru:"1930-\u0435, \u0424\u043e\u0442\u043e oldgrodno.by",en:"1930th, Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/towers/old/towers1970th.jpg",year:{ru:"1970-\u0435, \u0424\u043e\u0442\u043e grodnonews.by",en:"1970th, Photo grodnonews.by"},style:{width:7,height:4.2}},{source:"places/towers/old/towers1915-17.png",year:{ru:"1915-17 \u0433\u0433. \u0424\u043e\u0442\u043e oldgrodno.by",en:"1915-17, Photo oldgrodno.by"},style:{width:7,height:4.2}},{source:"places/towers/old/towers1968.png",year:{ru:"1968 \u0433. \u0424\u043e\u0442\u043e oldgrodno.by",en:"1968, Photo oldgrodno.by"},style:{width:7,height:4.2}}]}]};r.default=n},353);
