__d(function(e,o,t,n){Object.defineProperty(n,"__esModule",{value:!0});var a={name:"francisk",sound:"audio/vilenskaja.m4a",style:{},portals:[{name:"castles",transformPortal:[{translate:[15,0,4]}]},{name:"bridge",transformPortal:[{translate:[6,0,12]}]}],labels:[{offset:0,viewStyle:{transform:[{translate:[1,2.5,-5]},{scale:1.5}]},text:{ru:"\u041a\u043e\u0441\u0442\u0451\u043b \u0414\u0435\u0432\u044b \u041c\u0430\u0440\u0438\u0438 \u0410\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u043e\u0439",en:"Catholic Church of Mother of God of Angels"},description:{ru:"\u041c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c \u0444\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u0430\u043d\u0446\u0435\u0432 (\u041a\u043e\u0441\u0442\u0451\u043b \u0414\u0435\u0432\u044b \u041c\u0430\u0440\u0438\u0438 \u0410\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u043e\u0439) \u2014 \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043c\u043e\u043d\u0430\u0448\u0435\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0413\u0440\u043e\u0434\u043d\u043e (\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u044c). \u041f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b XVII \u0432\u0435\u043a\u0430.\n\n                          \u041c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0432 1635 \u0433\u043e\u0434\u0443 \u0443\u043f\u0438\u0442\u0441\u043a\u0438\u043c \u0441\u0442\u0430\u0440\u043e\u0441\u0442\u043e\u0439 \u0415\u0432\u0441\u0442\u0430\u0445\u0438\u0435\u043c \u041a\u0443\u0440\u0447\u043e\u043c \u0438 \u0435\u0433\u043e \u0436\u0435\u043d\u043e\u0439 \u0421\u044e\u0437\u0430\u043d\u043d\u043e\u0439 \u0438\u0437 \u0440\u043e\u0434\u0430 \u0422\u044b\u0448\u043a\u0435\u0432\u0438\u0447\u0435\u0439 \u043d\u0430 \u043b\u0435\u0432\u043e\u043c \u0431\u0435\u0440\u0435\u0433\u0443 \u0440\u0435\u043a\u0438 \u041d\u0435\u043c\u0430\u043d. \u041f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u044d\u0442\u043e \u0431\u044b\u043b \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u044b\u0439 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c \u0441 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u0438\u043c \u043a\u043e\u0441\u0442\u0451\u043b\u043e\u043c \u0410\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u043e\u0439 \u0411\u043e\u0436\u044c\u0435\u0439 \u041c\u0430\u0442\u0435\u0440\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0431\u044b\u043b \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043d \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0440\u0443\u0441\u0441\u043a\u043e-\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0432 1659 \u0433\u043e\u0434\u0443.\n\n                          \u0412 1660 \u0433\u043e\u0434\u0443 \u0431\u044b\u043b\u043e \u043d\u0430\u0447\u0430\u0442\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043a\u0430\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u0445\u0440\u0430\u043c\u0430 \u0441 \u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u043d\u0435\u0439 \u0432 \u0441\u0442\u0438\u043b\u0435 \u0431\u0430\u0440\u043e\u043a\u043a\u043e. \u0412 1759 \u0433\u043e\u0434\u0443 \u0446\u0435\u0440\u043a\u043e\u0432\u044c \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0435\u043d\u0430 \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u0436\u0430\u0440\u0430. \u0421 1853 \u0433\u043e\u0434\u0430 \u043a\u043e\u0441\u0442\u0451\u043b \u0431\u044b\u043b \u0437\u0430\u043a\u0440\u044b\u0442, \u0430 \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f 1863 \u0433\u043e\u0434\u0430 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0441\u044f \u043a\u0430\u043a \u0442\u044e\u0440\u044c\u043c\u0430 \u0434\u043b\u044f \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u0445 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u043e\u0432 \u0438 \u043c\u043e\u043d\u0430\u0445\u043e\u0432. \u041a\u0430\u043a \u0442\u044e\u0440\u044c\u043c\u0430 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0441\u044f \u0432\u043f\u043b\u043e\u0442\u044c \u0434\u043e 1919 \u0433\u043e\u0434\u0430.\n\n                          \u0412 \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u043c \u043e\u043d \u0432\u0441\u0435 \u0432\u0440\u0435\u043c\u044f \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0438\u0440\u043e\u0432\u0430\u043b \u043a\u0430\u043a \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c \u0444\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u0430\u043d\u0446\u0435\u0432. \u0412 1991 \u0433\u043e\u0434\u0443 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c \u0431\u044b\u043b \u0432\u0437\u044f\u0442 \u043f\u043e\u0434 \u043e\u043f\u0435\u043a\u0443 \u0432\u0435\u0440\u043d\u0443\u0432\u0448\u0438\u043c\u0438\u0441\u044f \u0432 \u0413\u0440\u043e\u0434\u043d\u043e \u0444\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u0430\u043d\u0446\u0430\u043c\u0438.\n\n                          \n \u0422\u0435\u043a\u0441\u0442 wikipedia.org",en:"The Franciscan monastery (Catholic church of Mother of God of Angels) is a catholic monastic complex in Grodno (Republic of Belarus). It is an architectural monument of the 18thI century.\n                        The monastic complex was founded in 1635 by the Upitsky governor Eustachy Curc and his wife Suzanne from the Tyszkiewicz family on the left bank of the Neman river. Originally it was a wooden monastery with a small church of Mother of God of Angels, which was destroyed during the Russian-Polish war in 1659.\n                        In 1660 the construction of a stone church with a bell tower in Baroque style started. In 1759 the church was rebuilt after a fire. Since 1853 the catholic church had been closed, and after the Polish Uprising of 1863 the monastery was used as a prison for Polish priests and monks. The monastery was used as a prison until 1919.\n                        In the years that followed it always functioned like a Franciscan monastery. In 1991 the monastery was taken under the care of the Franciscans that returned to Grodno."},infoPosition:1900,galleryStyle:{transform:[{translate:[-4,5.5,-9]}]},oldImages:[{source:"places/francisk/old/kostelXX.png",year:{ru:"XX \u0432. A\u0432\u0442\u043e\u0440 \u042f.\u0411\u0443\u043b\u0433\u0430\u043a",en:"20th c. Author J.Bulgak"},style:{width:8,height:4.9}},{source:"places/francisk/old/kostelXX-1.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by",en:"20th c. Photo oldgrodno.by"},style:{width:8,height:4.9}},{source:"places/francisk/old/kostelXX-2.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by, A\u0432\u0442\u043e\u0440 \u042f.\u0411\u0443\u043b\u0433\u0430\u043a",en:"20th c. Photo oldgrodno.by, author J.Bulgak"},style:{width:8,height:4.9}},{source:"places/francisk/old/kostelXX-3.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by",en:"20th c. Photo oldgrodno.by"},style:{width:8,height:4.9}},{source:"places/francisk/old/kostelXX-4.png",year:{ru:"XX \u0432. \u0424\u043e\u0442\u043e oldgrodno.by",en:"20th c. Photo oldgrodno.by"},style:{width:8,height:4.9}}]}]};n.default=a},370);
